const SingleDefaultLayout = ({ children }) => {
  const setDefaultBg = () => {
    const colors = ["beige", "tomatoe", "green", "blue", "purple"];
    const rndInt = Math.floor(Math.random() * 5) + 1;
    return colors[rndInt];
  };
  return (
    <div className="col-lg-3  mb-5">
      <div className="default-card" style={{ backgroundColor: setDefaultBg() }}>
        {children}
      </div>
    </div>
  );
};

export default SingleDefaultLayout;
